    HomeOutlined,
    SettingFilled,
    SmileOutlined,
    SyncOutlined,
    LoadingOutlined,
    BulbTwoTone,
    PieChartTwoTone,
    StarTwoTone,
    FundTwoTone,
    CompassTwoTone

  } from '@ant-design/icons';
import { Layout, Menu, Breadcrumb,Button,Space,Card, Col, Row} from 'antd';
import React from 'react';
import { Routes,BrowserRouter as Router,Route,Link,NavLink,Outlet  } from 'react-router-dom';

const { Header, Content, Footer } = Layout;
class Home extends React.Component{
    render(){
        return(

            // <div style={{justifyContent: 'center'},{textAlign: 'center'},{margin: "auto"},{top:0},{left: 0},{right: 0},{bottom: 0}}>
                
                
                
               
                
                // {/* <BulbTwoTone style={{ fontSize: '100px', color: '#08c'}} key="visual"> </BulbTwoTone>
                // <Link to="/visual/history">基础功能</Link>
                // <PieChartTwoTone style={{ fontSize: '100px', color: '#08c'} } />
                // <StarTwoTone style={{ fontSize: '100px', color: '#08c' }}/> */}
                // {/* <div className="site-card-wrapper" style={{justifyContent: 'center'}, {textAlign: 'center'}}>
                <Layout>
                    <Layout>
                        <Header style={{height:"90px"}}>
                       <div style={{fontWeight: "bold"},{fontSize: "80px"}}>Bronze Ware</div> 
                        </Header>
                    </Layout>
                    <br/>
                <Layout>
                <Content style={{ padding: '0 50px' },{height:"500px"}}>
                  <div className="site-card-wrapper">
                    <Row gutter={16}>
                    <Col span={8}>
                        <Card  hoverable title="基础功能" bordered={false} key="visual" style={{textAlign: 'center'}}>
                        <NavLink to="/visual/history"><FundTwoTone style={{ fontSize: '100px', color: '#08c'}}/></NavLink>
                        </Card>
                    </Col>
                    <Col span={8}>
                        <Card  hoverable title="高级功能" bordered={false} key="advanced" style={{textAlign: 'center'}}>
                        <NavLink to="/advanced"><CompassTwoTone style={{ fontSize: '100px', color: '#08c'}}/></NavLink>
                        </Card>
                    </Col>
                    <Col span={8}>
                        <Card  hoverable title="更多功能" bordered={false} key="expert" style={{textAlign: 'center'}}>
                        <NavLink to="/expert"><StarTwoTone style={{ fontSize: '100px', color: '#08c' }}/></NavLink>
                        </Card>
                    </Col>
                    </Row>
                     </div>
                    </Content>
                </Layout>
                </Layout>   
               

              
                
                
            
            
            )
    }
}
export default Home;
